    const cart = useSelector(state => state.cart.cartInfo.cart)
    console.log(cart)
    useEffect(() => {
       dispatch(fetchCart())
    }, [])
    return (
        <div>
            <div className='products' >
                <div className='items'>
                    {
                        cart.map()
                    }
                </div>        
            </div>
            <div className='bill'>

            </div>
        </div>
    )
}

export default Cart
